def is_samepatterns(arr, patterns):
    if len(arr) != len(patterns):
        return False
    mapped = {}
    used = set()
    for word, pat in zip(arr, patterns):
        if pat not in mapped:
            if word in used:
                return False
            mapped[pat] = word
            used.add(word)
        elif mapped[pat] != word:
            return False
    return True

