def get_total_number_of_sequences(m, n):
    from functools import lru_cache
    @lru_cache(None)
    def helper(length, last):
        if length == 1:
            return 1
        return sum(helper(length - 1, x) for x in range(1, last // 2 + 1))
    return sum(helper(n, x) for x in range(1, m + 1))

def get_total_number_of_sequences(n, m):
    dp = [[0]*(m+1) for _ in range(n+1)]
    for x in range(1, m+1):
        dp[1][x] = 1
    for i in range(2, n+1):
        prefix = [0]*(m+1)
        for x in range(1, m+1):
            prefix[x] = prefix[x-1] + dp[i-1][x]
        for x in range(1, m+1):
            if 2*x <= m:
                dp[i][x] = prefix[m] - prefix[2*x-1]
    return sum(dp[n])

