def get_max_sum(n, memo=None):
    if memo is None:
        memo = {}
    if n == 0:
        return 0
    if n in memo:
        return memo[n]
    result = max(
        n,
        get_max_sum(n // 2, memo)
        + get_max_sum(n // 3, memo)
        + get_max_sum(n // 4, memo)
        + get_max_sum(n // 5, memo)
    )
    memo[n] = result
    return result

