def next_smallest_palindrome(n):
    s = str(n)
    if all(ch == '9' for ch in s):
        return n + 2
    length = len(s)
    mid = length // 2
    if length % 2 == 0:
        left, middle, right = s[:mid], "", s[mid:]
    else:
        left, middle, right = s[:mid], s[mid], s[mid+1:]
    def make_pal(l, m, odd):
        return l + m + l[::-1] if odd else l + l[::-1]
    pal = make_pal(left, middle, length % 2 == 1)
    if pal > s:
        return int(pal)
    if length % 2 == 0:
        new_left = str(int(left) + 1)
        if len(new_left) > len(left):
            return int(new_left + new_left[:-1][::-1])
        return int(new_left + new_left[::-1])
    else:
        new_lpm = str(int(s[:mid+1]) + 1)
        if len(new_lpm) > (mid + 1):
            return int(new_lpm + new_lpm[:-1][::-1])
        return int(new_lpm + new_lpm[:-1][::-1])

