    def sum_of_proper_divisors(x):
        if x < 2:
            return 0
        s = 1
        r = int(x**0.5)
        for i in range(2, r + 1):
            if x % i == 0:
                s += i
                if i != x // i:
                    s += x // i
        return s
    total = 0
    for i in range(2, n + 1):
        s = sum_of_proper_divisors(i)
        if s != i and sum_of_proper_divisors(s) == i:
            total += i
    return total

