    def kadane(a):
        max_current = max_global = a[0]
        for x in a[1:]:
            max_current = max(x, max_current + x)
            max_global = max(max_global, max_current)
        return max_global

    total = sum(arr)
    best_single = kadane(arr)
    if k == 1:
        return best_single

    prefix_sum, current = float('-inf'), 0
    for x in arr:
