def bell_Number(n):
    import math
    if n < 0:
        raise ValueError("n must be nonnegative.")
    if n == 0:
        return 1
    bell = [0]*(n+1)
    bell[0] = 1
    for i in range(1, n+1):
        total = 0
        for k in range(i):
            total += math.comb(i-1, k) * bell[k]
        bell[i] = total
    return bell[n]

def bell_Number(n):
    from math import comb
    B = [1]
    for i in range(1, n + 1):
        s = 0
        for k in range(i):
            s += comb(i - 1, k) * B[k]
        B.append(s)
    return B[n]

assert bell_Number(2) == 2

