def heap_sort(arr):
    n = len(arr)
    def heapify(a, l, i):
        largest = i
        left = 2*i + 1
        right = 2*i + 2
        if left < l and a[left] > a[largest]:
            largest = left
        if right < l and a[right] > a[largest]:
            largest = right
        if largest != i:
            a[i], a[largest] = a[largest], a[i]
            heapify(a, l, largest)
    for i in range(n//2 - 1, -1, -1):
        heapify(arr, n, i)
    for i in range(n-1, 0, -1):
        arr[0], arr[i] = arr[i], arr[0]
        heapify(arr, i, 0)
    return arr

