def odd_length_sum(arr):
    n = len(arr)
    prefix = [0]*(n+1)
    for i in range(n):
        prefix[i+1] = prefix[i] + arr[i]
    total = 0
    for start in range(n):
        for end in range(start, n):
            length = end - start + 1
            if length % 2 == 1:
                total += prefix[end+1] - prefix[start]
    return total

