def right_insertion(arr, val):
    low, high = 0, len(arr)
    while low < high:
        mid = (low + high) // 2
        if val < arr[mid]:
            high = mid
        else:
            low = mid + 1
    return low

def right_insertion(a, x):
    lo, hi = 0, len(a)
    while lo < hi:
        mid = (lo + hi) // 2
        if x < a[mid]:
            hi = mid
        else:
            lo = mid + 1
    return lo

